  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Hawaiian
  Islands NWR outlines Refuge accomplishments during the 1970 calendar year. The report
  begins with an introduction to the Refuge, followed by a discussion of the Rare
  and Endangered Species Program. River Basin activities are outlined, and management
  and enforcement are discussed. Wildlife Services are also covered. The report summarizes
  weather conditions and habitat conditions during the year. Wildlife- including migratory
  birds, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, collections and receipts, and vegetation
  control. Resource management is outlined. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses and Refuge participation. Photographs, a Refuge brochure,
  and an endangered waterbird brochure are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
